import React, { useEffect } from "react";
import { useFormik } from "formik";
import {
  Box,
  Button,
  FormControl,
  FormErrorMessage,
  FormLabel,
  Heading,
  Input,
  Textarea,
  VStack,
} from "@chakra-ui/react";
import * as Yup from 'yup';
import emailjs from 'emailjs-com';  // Import EmailJS SDK
import FullScreenSection from "./FullScreenSection";
import { useAlertContext } from "../context/alertContext";
import useSubmit from "../hooks/useSubmit";

const ContactMeSection = () => {
  const { isLoading, response, submit } = useSubmit();
  const { onOpen } = useAlertContext();

  const formik = useFormik({
    initialValues: {
      firstName: '',
      email: '',
      contact: '',
      comment: '',
    },
    onSubmit: (values) => {
      sendEmail(values);
    },
    validationSchema: Yup.object({
      firstName: Yup.string().required('Name is required'),
      email: Yup.string().email('Invalid email').required('Email is required'),
      comment: Yup.string().required('Message is required'),
    }),
  });

  // Function to send email using EmailJS
  const sendEmail = (formData) => {
    const templateParams = {
      from_name: formData.firstName,
      from_email: formData.email,
      contact: formData.contact,
      message: formData.comment,
    };

    emailjs
      .send(
        'your_service_id',    // Replace with your EmailJS service ID
        'your_template_id',   // Replace with your EmailJS template ID
        templateParams,
        'your_user_id'        // Replace with your EmailJS user ID
      )
      .then(
        (result) => {
          console.log('Email sent successfully:', result.text);
          onOpen('Success', 'Your message has been sent successfully!');
        },
        (error) => {
          console.log('Email sending error:', error.text);
          onOpen('Error', 'There was an error sending your message.');
        }
      );
  };

  return (
    <FullScreenSection
      isDarkBackground
      backgroundColor="#0F0F0F"
      py={16}
      spacing={8}
    >
      <VStack w="1024px" p={32} alignItems="flex-start">
        <Heading as="h1" id="contactme-section" color="#DAA520">
          Contact me
        </Heading>
        <Box p={6} rounded="md" w="100%">
          <form onSubmit={formik.handleSubmit}>
            <VStack spacing={4}>
              <FormControl isInvalid={formik.errors.firstName && formik.touched.firstName}>
                <FormLabel htmlFor="firstName">Name</FormLabel>
                <Input
                  id="firstName"
                  name="firstName"
                  value={formik.values.firstName}
                  onChange={formik.handleChange}
                  onBlur={formik.handleBlur}
                  required
                />
                <FormErrorMessage>{formik.errors.firstName}</FormErrorMessage>
              </FormControl>
              <FormControl isInvalid={formik.errors.email && formik.touched.email}>
                <FormLabel htmlFor="email">Email Address</FormLabel>
                <Input
                  id="email"
                  name="email"
                  type="email"
                  value={formik.values.email}
                  onChange={formik.handleChange}
                  onBlur={formik.handleBlur}
                  required
                />
                <FormErrorMessage>{formik.errors.email}</FormErrorMessage>
              </FormControl>
              <FormControl isInvalid={formik.errors.contact && formik.touched.contact}>
                <FormLabel htmlFor="contact">Contact No</FormLabel>
                <Input
                  id="contact"
                  name="contact"
                  type="tel"
                  pattern="[0-9]{8}"
                  value={formik.values.contact}
                  onChange={formik.handleChange}
                  onBlur={formik.handleBlur}
                />
                <FormErrorMessage>{formik.errors.contact}</FormErrorMessage>
              </FormControl>
              <FormControl isInvalid={formik.errors.comment && formik.touched.comment}>
                <FormLabel htmlFor="comment">Your message</FormLabel>
                <Textarea
                  id="comment"
                  name="comment"
                  height={250}
                  value={formik.values.comment}
                  onChange={formik.handleChange}
                  onBlur={formik.handleBlur}
                  required
                />
                <FormErrorMessage>{formik.errors.comment}</FormErrorMessage>
              </FormControl>
              <Button type="submit" background="#DAA520" width="full" isLoading={isLoading}>
                Submit
              </Button>
            </VStack>
          </form>
        </Box>
      </VStack>
    </FullScreenSection>
  );
};

export default ContactMeSection;
